import './styling.css';
import {Container, Row, Col} from 'react-bootstrap';
import headshot from '../images/headshot.jpg';


function Introduction() {
    return (
        <div>
        <Row>
            <Col>
                <div>
                    <img src={headshot} className="HeadShot" alt="logo" />
                </div>
            </Col>
            <Col>Howdy</Col>
        </Row>

        </div>
    );

}

export default Introduction;
